            </div>
            <div>
                ava + description
            </div>
            <div className={s.posts}>
                My posts
                <div className={s.post_item}>
                    New post
                </div>
                <div>
                    post 1
                </div>
                <div>
                    post 2
                </div>
            </div>
        </div>
    );
};

export default Content;
